    render() {

        return (
            <div className='section-share about-section'>
                <div className='section-container'>
                    <div className='section-header'>
                        <div className='title-section'>Giới thiệu về Thủy sinh</div>
                    </div>
                    <div className='section-about-content'>
                        <div className='content-left'>
                            <iframe
                                width="100%"
                                height="100%"
                                src="https://www.youtube.com/embed/NdtBtmSNC7o"
                                title="Thư viện Thủy Sinh - Các phong cách chơi Thủy Sinh phổ biến"
                                frameborder="0"
                                allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share"
                                allowfullscreen>
                            </iframe>
                        </div>
                        <div className='content-right'>
                            <blockquote className="tiktok-embed" cite="https://www.tiktok.com/@bai_aquatic/video/7252200699986005254" data-video-id="7252200699986005254" style={{ maxWidth: "605px", minWidth: "325px" }} > <section> <a target="_blank" title="@bai_aquatic" href="https://www.tiktok.com/@bai_aquatic?refer=embed">@bai_aquatic</a> Bể cá dài 60 rộng 20. <a title="bểnuôicá" target="_blank" href="https://www.tiktok.com/tag/b%E1%BB%83nu%C3%B4ic%C3%A1?refer=embed">#bểnuôicá</a> <a title="bểcáthuỷsinh" target="_blank" href="https://www.tiktok.com/tag/b%E1%BB%83c%C3%A1thu%E1%BB%B7sinh?refer=embed">#bểcáthuỷsinh</a> <a title="huế75" target="_blank" href="https://www.tiktok.com/tag/hu%E1%BA%BF75?refer=embed">#huế75</a> <a title="huế" target="_blank" href="https://www.tiktok.com/tag/hu%E1%BA%BF?refer=embed">#huế</a> <a title="cácảnh" target="_blank" href="https://www.tiktok.com/tag/c%C3%A1c%E1%BA%A3nh?refer=embed">#cácảnh</a> <a title="beyaquatic" target="_blank" href="https://www.tiktok.com/tag/beyaquatic?refer=embed">#beyaquatic</a> <a title="thuỷsinh" target="_blank" href="https://www.tiktok.com/tag/thu%E1%BB%B7sinh?refer=embed">#thuỷsinh</a> <a target="_blank" title="♬ Dragostea Din Tei (抖音完整原版)" href="https://www.tiktok.com/music/Dragostea-Din-Tei-抖音完整原版-6873503664561096718?refer=embed">♬ Dragostea Din Tei (抖音完整原版)</a> </section> </blockquote> <script async src="https://www.tiktok.com/embed.js"></script>
                        </div>
                    </div>
                </div>
            </div>
        );
    };

}

const mapStateToProps = state => {
    return {
        isLoggedIn: state.user.isLoggedIn,
        language: state.app.language
    };
};

const mapDispatchToProps = dispatch => {
    return {
    };
};

export default connect(mapStateToProps, mapDispatchToProps)(About);
